import React from 'react'
import './cartCheckout.scss'

const CartCheckout = () => {
    
//   let items=JSON.parse(localStorage.getItem('cart'))
//   let totalPrice = 0
//   items.map(item => {
//     totalPrice += item.productPrice})

    return (
        <div className='cartCheckout'>
            <h3>Cart totals</h3>
            <hr />
            <div>
                <p>Subtotal</p>
                {/* <p>{totalPrice} $</p> */}
            </div>
            <hr />
            <div>
                <p>Shipping</p>
                <p>Free Shipping</p>
            </div>
            <hr />
            <div>
                <p>Total</p>
                {/* <p>{totalPrice} $</p> */}
            </div>
            <button>
                Checkout
            </button>
        </div>
    )
}

export default CartCheckout
